import React from "react";

const PlayDataTabBar = (props) => {
    const handleOnClick = (e) => {
        props.updatePlayData(e.target.title);
    }

    return (
        <div className="container">
            <button title="details" onClick={handleOnClick}>Details</button>
            <button title="characters" onClick={handleOnClick}>Characters</button>
            <button title="text" onClick={handleOnClick}>Text</button>
        </div>
    );
};

export default PlayDataTabBar
